import classes from './css/Header.module.css';
import HeaderSectionButton from './HeaderSectionButton';

const Header = () => {
    return (
        <header className={classes.header}>
            <span>Caamps Cinema</span>
            <HeaderSectionButton/>
        </header>
    )
}

export default Header;
